import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import ContainedButtons from "../ui/ContainedButttons";
import HomeIcon from "./HomeIcon";
import "../../../../index.css";
import Link from "@material-ui/core/Link";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    fontFamily: "Lobster",
  },
}));

export default function GenNavBar(props) {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar
        position="fixed"
        style={{
          background: "transparent",
          boxShadow: "none",
        }}
      >
        <Toolbar style={{ width: "auto", height: "auto" }}>
          <div style={{ width: "auto" }}>
            <Typography
              variant="h6"
              className={classes.title}
              style={{ textAlign: "left" }}
            >
              <Link href="/" style={{ color: "#2a6bf4" }}>
                My Portfolio
              </Link>
            </Typography>
          </div>
          <div
            style={{
              width: "auto",
            }}
          >
            <HomeIcon style={{ color: "#2a6bf4" }}></HomeIcon>
          </div>

          <div style={{ width: "61%" }}></div>
          <div style={{ width: "7%" }}>
            <Link href="/" style={{ color: "#2a6bf4" }}>
              Learn More
            </Link>
          </div>
          <div style={{ width: "7%" }}>
            <Link href="/" style={{ color: "#2a6bf4" }}>
              Contact Us
            </Link>
          </div>
          <div style={{ width: "auto" }}>
            <ContainedButtons
              signInNav={props.signInNav}
              signUpNav={props.signUpNav}
            ></ContainedButtons>
          </div>
        </Toolbar>
      </AppBar>
      <Toolbar />
    </div>
  );
}
